$templateCache.put('static/html/bugreport.html','<div style="text-align: left; margin: auto; width: 800px">\r\n\r\n\r\n    <div class="panel panel-default">\r\n        <div class="panel-heading">\r\n            <h3 class="panel-title">Bugreport / Debug infos</h3>\r\n        </div>\r\n        <div class="panel-body">\r\n            So you found a bug? Ideally <a href="https://github.com/theotherp/nzbhydra/issues/new" target="_blank">raise an issue on github</a>. If you don\'t have an account create one ;-) Otherwise\r\n            <a\r\n                    href="mailto:theotherp@gmx.de">send me a mail</a>.<br>\r\n            <b>But</b> please read this first:<br>\r\n            Don\'t just tell me what the problem is. If you just post an exception from the console or say "x does not work" I probably won\'t be willing or able to help. Remember you want something\r\n            from\r\n            me.<br>\r\n            <ul>\r\n                <li>\r\n                    Tell me what you expect to happen and what actually happens\r\n                </li>\r\n                <li>\r\n                    If hydra doesn\'t even start, tell me your OS and how you start it.\r\n                </li>\r\n                <li>\r\n                    If the website looks weird tell me what browser you use. If you use a reverse proxy post your config and your base URL setting.\r\n                </li>\r\n                <li>\r\n                    If the GUI behaves strangely or doesn\'t react as it should check the browser console for errors.\r\n                </li>\r\n            </ul>\r\n            Tell me anything that might help. If you do all that I will do my best to help you and improve NZBHydra.\r\n\r\n            <br><br>\r\n            If possible provide the log and your settings. Here you can get anonymized versions of both to be posted:<br>\r\n\r\n            <button class="btn btn-default" ng-click="downloadDebuggingInfos()">Log and settings</button>\r\n        </div>\r\n    </div>\r\n\r\n    <div class="panel panel-default">\r\n        <div class="panel-heading">\r\n            <h3 class="panel-title">Debug SQL execution</h3>\r\n        </div>\r\n        <div class="panel-body">\r\n            You may want to take a look at the settings to make sure there\'s nothing in there you wouldn\'t want me to see.\r\n            <br><br><br>\r\n            You can use the input box below to execute any SQL query against the database. You will likely never need this but it allows me to ask you to execute a query when I try to solve a bug.\r\n            <br>\r\n            <textarea class="form-control" rows="5" data-ng-model="foo.sql"></textarea>\r\n            <button class="btn btn-default" ng-click="executeSqlQuery()">Query</button>\r\n            <button class="btn btn-default" ng-click="executeSqlUpdate()">Execute</button>\r\n            <textarea class="form-control" rows="10" data-ng-model="foo.csv"></textarea>\r\n        </div>\r\n    </div>\r\n\r\n</div>');
